import React from 'react';
import {UsersPagePropsType} from "./UsersContainer";

const Users = (state: UsersPagePropsType) => {
    console.log(state.usersPage)
    return (
        <div>
            USERS
            {
                state.usersPage.map(u =>
                    <div key={u.id}>
                        <span>
                             <div>{u.name}</div>
                            <div>{u.followed}</div>
                        </span>
                        <div>
                            <button>Follow</button>
                        </div>
                    </div>
                )
            }
        </div>
    );
};

export default Users;
